  wordBreak: true,
  whiteSpace: true
});
var Typography = styled(Box).withConfig({
  shouldForwardProp: shouldForwardProp
}).withConfig({
  displayName: "Typography",
  componentId: "sc-1ucmpew-0"
})(["font-family:", ";overflow-wrap:break-word;", ";", " ", " ", " ", ""], fromTheme('typography.fontFamily'), makeTypographyVariant, makeEllipsis, typography, color, customProps);
